import React, { useState, useRef, useEffect } from 'react';
import './App.css';
import { ReactComponent as MagicIcon } from './magic.svg'; // Assuming you have a magic.svg file

function App() {
  const [showInput, setShowInput] = useState(false);
  const [showOptions, setShowOptions] = useState(false);
  const [showToneOptions, setShowToneOptions] = useState(false);
  const [aiInput, setAiInput] = useState('');
  const aiButtonRef = useRef(null);
  const inputRef = useRef(null);

  const handleAiButtonClick = () => {
    setShowInput(true);
    setShowOptions(false);
  };

  const handleInputBlur = () => {
    setShowInput(false);
  };

  const handleInputChange = (e) => {
    setAiInput(e.target.value);
  };

  const handleInputSubmit = () => {
    // Simulate API call
    console.log(`AI command submitted: ${aiInput}`);
    setShowInput(false);
  };

  const handleAiOptionClick = (option) => {
    console.log(`AI option selected: ${option}`);
    setShowToneOptions(false);
    // Simulate API call
    setShowInput(false);
  };

  const handleToneOptionClick = (option) => {
    console.log(`Tone option selected: ${option}`);
    // Simulate API call
    setShowToneOptions(false);
  };

  const handleChangeToneClick = () => {
    setShowToneOptions(true);
  };

  useEffect(() => {
    const handleClickOutside = (event) => {
      if (inputRef.current && !inputRef.current.contains(event.target) && !aiButtonRef.current.contains(event.target)) {
        setShowInput(false);
        setShowOptions(false);
        setShowToneOptions(false);
      }
    };
    document.addEventListener('mousedown', handleClickOutside);
    return () => {
      document.removeEventListener('mousedown', handleClickOutside);
    };
  }, []);

  return (
    <div className="App">
      <div ref={aiButtonRef} className="ask-ai-button" onClick={handleAiButtonClick}>
        <MagicIcon className="magic-icon" /> Ask AI
      </div>

      {showInput && (
        <div ref={inputRef} className="ai-input-container">
          <input
            type="text"
            value={aiInput}
            onChange={handleInputChange}
            onBlur={handleInputBlur}
            placeholder="Ask AI to edit or generate"
          />
          <button className="submit-button" onClick={handleInputSubmit}>
            <svg viewBox="0 0 24 24">
              <path d="M12 2L3.5 20.29 9 14h6l5.5 6.29L12 2z"></path>
            </svg>
          </button>
        </div>
      )}

      {showOptions && (
        <div className="ai-options">
          <div className="ai-option" onClick={() => handleAiOptionClick('make-shorter')}>
            <svg viewBox="0 0 24 24">
              <path d="M12 4v16m-8-8h16"></path>
            </svg>
            Make shorter
          </div>
          <div className="ai-option" onClick={() => handleAiOptionClick('make-longer')}>
            <svg viewBox="0 0 24 24">
              <path d="M12 4v16m-8-8h16"></path>
            </svg>
            Make longer
          </div>
          <div className="ai-option" onClick={handleChangeToneClick}>
            <svg viewBox="0 0 24 24">
              <path d="M12 4v16m-8-8h16"></path>
            </svg>
            Change tone
          </div>
          <div className="ai-option" onClick={() => handleAiOptionClick('improve-language')}>
            <svg viewBox="0 0 24 24">
              <path d="M12 4v16m-8-8h16"></path>
            </svg>
            Improve language
          </div>
        </div>
      )}

      {showToneOptions && (
        <div className="tone-options">
          <div className="ai-option" onClick={() => handleToneOptionClick('friendly')}>
            <svg viewBox="0 0 24 24">
              <path d="M12 4v16m-8-8h16"></path>
            </svg>
            Friendly
          </div>
          <div className="ai-option" onClick={() => handleToneOptionClick('optimistic')}>
            <svg viewBox="0 0 24 24">
              <path d="M12 4v16m-8-8h16"></path>
            </svg>
            Optimistic
          </div>
          <div className="ai-option" onClick={() => handleToneOptionClick('respectful')}>
            <svg viewBox="0 0 24 24">
              <path d="M12 4v16m-8-8h16"></path>
            </svg>
            Respectful
          </div>
          <div className="ai-option" onClick={() => handleToneOptionClick('assertive')}>
            <svg viewBox="0 0 24 24">
              <path d="M12 4v16m-8-8h16"></path>
            </svg>
            Assertive
          </div>
          <div className="ai-option" onClick={() => handleToneOptionClick('surprise-me')}>
            <svg viewBox="0 0 24 24">
              <path d="M12 4v16m-8-8h16"></path>
            </svg>
            Surprise me
          </div>
        </div>
      )}
    </div>
  );
}

export default App;
